import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { connect } from "react-redux"
import Navigation from './components/Navigation/index'
import AuthNav from "./components/Navigation/AuthNav"
import FoodMenu from '../src/Pages/Restaurant/Components/FoodMenu'
import DashMenu from '../src/Pages/Restaurant/Components/DashMenu'
// import MenuPage from '../src/Pages/Restaurant/RestauMenuPage'
import HeaderWrapper from './components/Header/HeaderWraper/index'
class App extends Component {

  render(){
  return (

    <div className="App">
     <DashMenu />
     <br/>
     <HeaderWrapper />

    
    </div>
  );
}

}

export default connect() (App);
